CREATE TABLE Distrito (
	ID_Distrito int IDENTITY (1, 1) NOT NULL,
	Descricao_Distrito varchar (MAX) NOT NULL,
	Sigla_UF char (2) NOT NULL,
	Situacao BIT NULL DEFAULT 1,
	DataInclusao DATETIME NULL DEFAULT GETDATE(),
	DataAlteracao DATETIME NULL,
	DataExclusao DATETIME NULL,
	CONSTRAINT PK_Distrito PRIMARY KEY (ID_Distrito),
	CONSTRAINT FK_Distrito_UF FOREIGN KEY (Sigla_UF) REFERENCES Unidades_Federacao(Sigla_UF)
)
GO

SET IDENTITY_INSERT Distrito ON


SET IDENTITY_INSERT Distrito OFF
